import React, {useState} from 'react';
import './App.css';

//components
import Toolbar from '../src/components/Toolbar/Toolbar'
import SideDrawer from './components/SideDrawer/SideDrawer';
import Backdrop from './components/Backdrop/Backdrop';

function App() {

  const [sideDrawerOpened, setSideDrawer] = useState(false);

  return (
    <div className="App">
      <Toolbar click={(prevState) => setSideDrawer(!sideDrawerOpened)}/>
      <SideDrawer sideDrawerOpened={sideDrawerOpened}/>
      {sideDrawerOpened ? <Backdrop/> : null}


      {/* copipasta */}

      <div class="container">
  <div id="marketing" class="section">
    <div class="content">
      <h1>Marketing</h1>
    </div>
    <div class="overlay"></div>
  </div>
  <div id="technology" class="section">
    <div class="content">
      <h1>Technology</h1>
    </div>
    <div class="overlay"></div>
  </div>
  <div id="advertising" class="section">
    <div class="content">
      <h1>Advertising</h1>
    </div>
    <div class="overlay"></div>
  </div>
</div>



    </div>
  );
}

export default App;
